import React from "react";
import "./Title.css"
import TypeIt from "typeit-react";



const Title = () => {

  new TypeIt("#title", {
    strings: "This is my string!",
    speed: 75,
    loop: true
  }).go();


  return (
    <div id="title">
      <TypeIt>
        This will be typed 
      </TypeIt>
    </div>
  )

}

export default Title;
